  let num = 0;

  const catogriesFilter = ( data) =>{
      setCatogries(data)
    console.log(catogries)
  }
  return (
    <>
      <div className="filter-catogries">
        {FilterCatogries.map((filter) => {
          return (
            <>
              <div key={num++} className="filter-cat-name " onClick={()=>catogriesFilter(filter)}>
                {filter}
              </div>
            </>
          );
        })}
      </div>
      <ImagesresH />
    </>
  );
};

